/*# sourceMappingURL=data:application/json;base64, */</style><style>/* Alert and Confirm Dialog */

.mwAlertDialog.mwDialog .mwDialogBody,
.mwConfirmDialog.mwDialog .mwDialogBody,
.mwProgressDialog.mwDialog .mwDialogBody {
    overflow: hidden;
    max-width: 400px;
    box-sizing: content-box;
}

/*mw-dialog sets min-height to be 160px of dialogs.
Changing min-height to keep look similar to earlier version.*/
.mwProgressDialog.mwDialog {
    min-height: 0px;
}

.mwProgressDialog.mwDialog .mwDialogBody,
.mwProgressDialog.mwDialog .mwDialogBody.mwNoButtons {
    overflow: hidden;
    min-height: 0px;
}

.mwAlertDialog .mwIconAndMessageWidget,
.mwConfirmDialog .mwIconAndMessageWidget,
.mwProgressDialog .mwIconAndMessageWidget {
    overflow: hidden;
}

.mwAlertDialog .mwIconAndMessageWidgetIcon,
.mwConfirmDialog .mwIconAndMessageWidgetIcon,
.mwProgressDialog .mwIconAndMessageWidgetIcon {
    float: left;
    max-width: 32px;
    max-height: 32px;
    padding: 1px;
    padding-right: 10px;
}

.mwAlertDialog .mwIconAndMessageWidgetMessage,
.mwConfirmDialog .mwIconAndMessageWidgetMessage,
.mwProgressDialog .mwIconAndMessageWidgetMessage {
    overflow: auto;
    word-wrap: break-word;
    font-size: 14px;
    /* ENABLE Selection */
    -webkit-user-select: initial;
    -moz-user-select: initial;
    -ms-user-select: initial;
    user-select: initial;
}


/* Progress Dialog */

.mwProgressDialog .mwIconAndMessageWidget {
    min-width: 360px;
}

.mwProgressDialog .mwProgressDialogProgressBar {
    margin-top: 15px;
}

.mwProgressDialog .mwProgressDialogMessage {
    overflow: auto;
    max-height: 140px;
    font-size: 13px;
}


/* Banner Widget (experimental) */
.mwBanner {
    position: absolute;
    left: 0px;
    top: 0px;
    width: 100%;
    z-index: 900;
}

.mwBannerContainer {
    font-family: "Helvetica Neue", HelveticaNeue, Helvetica, Arial, sans-serif;
    border: 1px solid #919191;
    width: 90%;
    margin: auto;
    background: rgb(245, 245, 245);
    box-shadow: 0px 5px 10px 2px rgba(63, 63, 63, 0.4);
    max-height: 70px;
    border: 1px solid #919191;
    overflow: auto;
}

.mwBanner .mwBannerTitle {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    background: rgb(230, 230, 230);
    color: rgb(63, 63, 63);
    border-bottom: 1px solid rgb(216, 216, 216);
    font-size: 12px;
    font-weight: bold;
    padding: 5px;
}


/* Alert Banner (experimental) */
.mwAlertBanner .mwIconAndMessageWidget {
    padding: 5px;
    overflow: hidden;
}

.mwAlertBanner .mwIconAndMessageWidgetIcon {
    float: left;
    max-width: 16px;
    max-height: 16px;
    padding: 1px;
    padding-right: 10px;
}

.mwAlertBanner .mwIconAndMessageWidgetMessage {
    overflow: auto;
    word-wrap: break-word;
    font-size: 12px;
}

/*# sourceMappingURL=data:application/json;base64, */</style><style>.mwProgressBar {
    white-space: normal;
    --progress-color-info: #0099FF;
    --progress-color-warning: #F1B51C;
    --progress-color-error: #E23D2D;
    --progress-color-success: #22AC3C;
    /* default progress color */
    --progress-color: #0099FF;
}

.mwProgressBar .mwProgressBarGutter {
    overflow: hidden;
    width: 100px;
    height: 5px;
    background-color: rgb(230, 230, 230);
    box-shadow: inset 0px 1px 0 0 rgba(0, 0, 0, .1), 0px 1px 0 0 rgba(255, 255, 255, .35);
    transform-origin: left;
    transform: scaleX(1);
}

@keyframes mwProgressBarWaveAnimation {
    0% {
        background-position: -30px 100%;
    }
    100% {
        background-position: 150px 100%;
    }
}

.mwProgressBar .mwProgressBarProgress {
    box-shadow: inset 0px 1px 0 0 rgba(0, 0, 0, .1);
    width: 100px;
    height: 100%;
    transform-origin: left;
    transform: translateX(-100px);
    transition: transform .15s linear;
    background-image: linear-gradient(90deg, rgba(255, 255, 255, 0), rgba(255, 255, 255, .3) 40%, rgba(255, 255, 255, .3) 60%, rgba(255, 255, 255, 0));
    background-size: 30px 100%;
    background-position: -30px 100%;
    background-repeat: no-repeat;
    animation: mwProgressBarWaveAnimation 2s linear 1.5s infinite;
}

.mwProgressBar.mwProgressBarNoWave .mwProgressBarProgress,
.mwProgressBar:not(.mwProgressBarIndeterminate)[data-value="100"] .mwProgressBarProgress {
    animation: none;
}

@keyframes mwProgressBarIndeterminateAnimation {
    0% {
        transform: translateX(-25px);
    }
    100% {
        transform: translateX(100px);
    }
}

.mwProgressBar.mwProgressBarIndeterminate .mwProgressBarProgress {
    width: 25px;
    animation: mwProgressBarIndeterminateAnimation 1.5s cubic-bezier(0.3, 0.0, .9, 0.6) 0s infinite;
    transition: none;
    background-image: none;
}

.mwProgressBar .mwProgressBarInvisible,
.mwProgressBarIndeterminate .mwProgressBarText {
    display: none;
}

.mwProgressBarText {
    width: 100%;
